import {Route, Routes} from 'react-router-dom'
import Login from './components/Login'
import SignUp from './components/SignUp'

import './App.css';

const App = () => (

    <Routes>
    <Route exact path="/login" component = {Login}/>
    <Route exact path="/signup" component={SignUp}/>
  </Routes>
)

export default App;
